var ndeId = (msg._subflowOut || [""])[0].split(":")[1]

if (msg.action == "random") {

    setTimeout(() => {
        var v = Math.round(Math.random() * 100);
        var fillVal = (v < 20 ? "green" : (v < 40 ? "red" : (v < 60 ? "yellow" : (v < 80 ? "blue" : "grey"))))
        $($('#' + ndeId).find('rect')[0]).css('fill', fillVal)

        if (!msg.freeze) {
            setTimeout(() => { $($('#' + ndeId).find('rect')[0]).css('fill', 'white') }, (750 * Math.random()) + 250);
        }

        msg.column += 1;
        node.send(msg)
    }, msg.delay);
}

if (msg.action == "rolling") {
    var columns = [
        ["green", "yellow", "red", "blue"] //,"grey"],
    ];

    var clr = columns[msg.row % columns.length][msg.column % columns[0].length];

    setTimeout(() => {
        $($('#' + ndeId).find('rect')[0]).css('fill', clr)

        if (!msg.freeze) {
            setTimeout(() => { $($('#' + ndeId).find('rect')[0]).css('fill', 'white') }, 350);
        }

        msg.column += 1;
        node.send(msg)
    }, msg.delay);
}

if (msg.action == "dotmatrix") {
    var uint_8 = /* 16px by 16px, column major, big endian. @ http://dotmatrixtool.com */
        [
            0xfe, 0xff, 0x40, 0x88, 0x20, 0x8c, 0xfe, 0x8a, 0x00, 0x71, 0x7c, 0x00, 0x82, 0xff, 0x7c, 0x99, 0x00, 0x99, 0xfe, 0x81, 0x82, 0x00, 0x7c, 0xff, 0x00, 0x81, 0xfe, 0x81, 0x92, 0x42, 0x82, 0x3c, 0x00, 0x00
        ];
    var mod = uint_8.length / 2

    var b = uint_8.map((d) => { return ("000000000" + d.toString(2)).slice(-8) })
    var cidx = ((msg.column % mod) * 2) + (msg.row > 7 ? 1 : 0);
    var ridx = msg.row % 8;

    var clr = b[cidx][ridx] == "1" ? "red" : "white"

    setTimeout(() => {
        $($('#' + ndeId).find('rect')[0]).css('fill', clr)

        if (!msg.freeze) {
            setTimeout(() => { $($('#' + ndeId).find('rect')[0]).css('fill', 'white') }, 350);
        }

        msg.column += 1;
        node.send(msg)
    }, msg.delay);
}
